export const getItem=(key)=>{
    try{
        const data = localStorage.getData(key);
        return JSON.parse(data);
    } catch(error){
        console.log(error)
    }
}

export const setItem=(key,value)=>{
    try{
        const data = localStorage.setData(key,JSON.stringify(value));
        return true;
    } catch(error){
        console.log(error)
    }
}
